import { Playground, Props } from 'docz'
import ButtonIcon from './ButtonIcon'
import { AccessAlarm } from '../MaterialIcons/AccessAlarm'
import { Home } from '../MaterialIcons/Home'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};
const ThemeProvider = makeShortcode("ThemeProvider");
const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "button-icon"
    }}>{`Button Icon`}</h1>
    <Props of={ButtonIcon} mdxType="Props" />
    <Playground mdxType="Playground">
  <ThemeProvider mdxType="ThemeProvider">
    <ButtonIcon icon={AccessAlarm} title="alarm" mdxType="ButtonIcon" />
    <ButtonIcon icon={Home} title="home" mdxType="ButtonIcon" />
  </ThemeProvider>
    </Playground>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
